    "1103107": {
        "Desc": "Go to Fanmu Carpenter's and speak with Master Lu",
        "Talk": [
            [
                {
                    "N": "Fatui Skirmisher",
                    "T": "*cough*... You... Scoundrels..."
                },
                {
                    "N": "Ganyu",
                    "T": "I think you've had enough. About time you tell us your plan, no?"
                },
                {
                    "N": "Fatui Skirmisher",
                    "T": "Plan... What plan?"
                },
                {
                    "N": "Ganyu",
                    "T": "We just taught you a lesson, but clearly, you weren't paying attention."
                },
                {
                    "N": "Ganyu",
                    "T": "If you don't spill whatever you're scheming against Liyue..."
                },
                {
                    "N": "Ganyu",
                    "T": "We'll be forced to use harsher methods."
                },
                {
                    "N": "_0",
                    "T": "I think we were harsh enough."
                },
                {
                    "N": "_0",
                    "T": "Quick, tell us everything!"
                },
                {
                    "N": "Fatui Skirmisher",
                    "T": "I'm telling the truth. There's no scheme."
                },
                {
                    "N": "Ganyu",
                    "T": "If you're telling the truth, then why would you, a member of the Fatui, suddenly appear on the outskirts of Qingce Village?"
                },
                {
                    "N": "Fatui Skirmisher",
                    "T": "Fine. If you really want to know, then, well... I was about to..."
                },
                {
                    "N": "_1005",
                    "T": "About to... what?"
                },
                {
                    "N": "Fatui Skirmisher",
                    "T": "...Pick Berries over there."
                },
                {
                    "N": "Ganyu",
                    "T": "Um..."
                },
                {
                    "N": "Ganyu",
                    "T": "I must admit, I didn't expect you to come up with such a silly excuse."
                },
                {
                    "N": "Fatui Skirmisher",
                    "T": "It's not an excuse! I rarely have a free morning, and I heard that there were fresh Berries in this area..."
                },
                {
                    "N": "Fatui Skirmisher",
                    "T": "Think about it. I'm here alone and Qingce Village is nothing more than a retirement spot for old people. What could I be scheming, anyway?"
                },
                {
                    "N": "_1005",
                    "T": "Judging by how he's looking at us, it does seem like he feels like he's the victim here."
                },
                {
                    "N": "Ganyu",
                    "T": "So you have nothing to do with the occupation of Fanmu Carpenter's warehouse?"
                },
                {
                    "N": "Fatui Skirmisher",
                    "T": "Fanmu Carpenter's warehouse? Where is that?"
                },
                {
                    "N": "Fatui Skirmisher",
                    "T": "I swear, I only came here to pick Berries, that's all."
                },
                {
                    "N": "_1005",
                    "T": "So it wasn't the Fatui who took over Master Lu's warehouse, after all..."
                },
                {
                    "N": "_0",
                    "T": "We might have blamed him for nothing."
                },
                {
                    "N": "_0",
                    "T": "So that's it?"
                },
                {
                    "N": "Ganyu",
                    "T": "I also feel... that he's telling the truth."
                },
                {
                    "N": "_1005",
                    "T": "Uh, um... Whoopsie..."
                },
                {
                    "N": "Ganyu",
                    "T": "I misjudged the situation and offended you. My apologies."
                },
                {
                    "N": "Ganyu",
                    "T": "Our... Uh... Our exchange only represents my personal views. If you wish it so, you can file a complaint to the Ministry of Civil Affairs."
                },
                {
                    "N": "Fatui Skirmisher",
                    "T": "Exchange!?"
                },
                {
                    "N": "Fatui Skirmisher",
                    "T": "(T-this woman! She's clearly aware that the Ministry of Civil Affairs wouldn't side with us Fatui...)"
                },
                {
                    "N": "Ganyu",
                    "T": "Yes, precisely. As an alternative, you may... try to solve this problem with force once again."
                },
                {
                    "N": "_1005",
                    "T": "Paimon's in~!"
                },
                {
                    "N": "Fatui Skirmisher",
                    "T": "D—Darn you... How can you wear that solemn face while bullying me like this..."
                },
                {
                    "N": "Ganyu",
                    "T": "What's your choice then?"
                },
                {
                    "N": "Fatui Skirmisher",
                    "T": "...I'll get back to my Berries."
                },
                {
                    "N": "_0",
                    "T": "Good choice."
                },
                {
                    "N": "_0",
                    "T": "The Fatui get what they deserve!"
                },
                {
                    "N": "_1005",
                    "T": "What a bittersweet ending!"
                },
                {
                    "N": "Ganyu",
                    "T": "I made a laughingstock out of myself. I might've spent too much time away from work — my intuition is not as accurate as it used to be."
                },
                {
                    "N": "_1005",
                    "T": "No worries! It's always nice to teach the Fatui a lesson!"
                },
                {
                    "N": "Ganyu",
                    "T": "Hehe... Let's keep moving towards Master Lu's warehouse. Our goal is to get the invoice, after all."
                }
            ]
        ]
    },
